#include <iostream>

using namespace std;

void get_roots(double a, double b, double c) {
    double discriminant = b * b - 4 * a * c;

    if (discriminant < 0) {
        cout << "Ð£Ñ€Ð°Ð²Ð½ÐµÐ½Ð¸Ðµ Ð½Ðµ Ð¸Ð¼ÐµÐµÑ‚ ÐºÐ¾Ñ€Ð½ÐµÐ¹" << endl;
        return;
    }
    else if (discriminant == 0) {
        cout << "x = " << -b / (2 * a) << endl;
        return;
    }
    else {
        cout << "x1 = " << (-b + sqrt(discriminant)) / (2 * a) << endl;
        cout << "x2 = " << (-b - sqrt(discriminant)) / (2 * a) << endl;
    }
}

void get_roots(double a, double b) {
    cout << "x = " << -b / a << endl;
}



int main() {

    setlocale(LC_ALL, "ru");

    get_roots(2, 6, 4);
    get_roots(6, -2);
}

