template <typename T>
void display(T arr[], int size) {
    for (int i = 0; i < size; i++) {
        cout << arr[i] << " ";
    }
    cout << endl;
}

template<typename T>
void average(T arr[], int size) {
    T sum = 0;
    for (int i = 0; i < size; i++) {
        sum += arr[i];
    }
    cout << "Ð¡Ñ€ÐµÐ´Ð½ÐµÐµ Ð°Ñ€Ð¸Ñ„Ð¼ÐµÑ‚Ð¸Ñ‡ÐµÑÐºÐ¾Ðµ Ð¼Ð°ÑÑÐ¸Ð²Ð°: " << sum / size << endl;
}

int main() {

    setlocale(LC_ALL, "ru");

    int arr[]{ 1, 3, 7, -4, -2, 4 };
    int size = 6;
    display(arr, size);
    average(arr, size);


    double arr2[]{ 3.5, 2.5, 3.7, 1.0, 3.3, 7.2 };
    display(arr2, size);
    average(arr2, size);
}

