    connected = SerialBT.connect(slaveName);
    Serial.printf("Connecting to slave BT device named \"%s\"\n", slaveName.c_str());
  #else
    connected = SerialBT.connect(address);
    Serial.print("Connecting to slave BT device with MAC "); Serial.println(MACadd);
  #endif

  if(connected) {
    Serial.println("Connected Successfully!");
  } else {
    while(!SerialBT.connected(10000)) {
      Serial.println("Failed to connect. Make sure remote device is available and in range, then restart app.");
    }
  }
  // Disconnect() may take up to 10 secs max
  if (SerialBT.disconnect()) {
    Serial.println("Disconnected Successfully!");
  }
  // This would reconnect to the slaveName(will use address, if resolved) or address used with connect(slaveName/address).
  SerialBT.connect();
  if(connected) {
    Serial.println("Reconnected Successfully!");
  } else {
    while(!SerialBT.connected(10000)) {
      Serial.println("Failed to reconnect. Make sure remote device is available and in range, then restart app.");
    }
  }
}

void loop() {
  bool stateB1 = digitalRead(button1);
  bool stateB2 = digitalRead(button2);
  bool stateB3 = digitalRead(button3);
  bool stateB4 = digitalRead(button4);
  uint8_t value;
  
  if(stateB1 != lastStateB1){
    press1 = true;
    lastMillis = millis();
  }
  if(stateB2 != lastStateB2){
    press2 = true;
    lastMillis = millis();
  }
  if(stateB3 != lastStateB3){
    press3 = true;
    lastMillis = millis();
  }
  if(stateB4 != lastStateB4){
    press4 = true;
    lastMillis = millis();
  }
  if(press1 || press2 || press3 || press4){
    if(millis() - lastMillis >= DEBOUNCE){
      if(press1){
        if(stateB1 == LOW){
          value = 1;
        }
        press1 = false;
      }else if(press2){
        if(stateB2 == LOW){
          value = 2;
        }
        press2 = false;
      }else if(press3){
        if(stateB3 == LOW){
          value = 3;
        }
        press3 = false;
      }else if(press4){
        if(stateB4 == LOW){
          value = 4;
        }
        press1 = false;
      }
      if (SerialBT.available()) {
        SerialBT.write(value);
        Serial.printf("BT Sent: %u\n", value);
      }else{
        Serial.println("NO Bluetooth Connection, Send Fail!\n");
      }
    }
  }
  
  lastStateB1 = stateB1;
  lastStateB2 = stateB2;
  lastStateB3 = stateB3;
  lastStateB4 = stateB4;
  delay(20);
}

